/**
 * 本文件用于查询大学的信息
 *
 * 使用方式
 * <code>
 *    $name = UCLibUniversity::getName(1); // 返回id为1的大学的名称
 *    $list = UCLibUniversity::getUniversits(); // 返回所有的大学列表
 * </code>
 *
 * @author    徐鹏程 <xupengcheng@snda.com>
 * @version   0.0.1		2010/03/29
 */

class UCLibUniversity {

	/**
	 * 根据大学id获取大学院系列表
	 * @param unv_id: 大学id
	 * @return 大学院系列表，比如
	 *    array("计算机系", "化学院")
	 */
	public static function getDeps($unv_id) {
		if (isset(self::$_university_deps[$unv_id])) {
			return self::$_university_deps[$unv_id];
		} else {
			return array();
		}
	}
	
	/**
	 * 根据大学名称获取大学院系列表
	 * @param unv_name: 大学名称
	 * @return 大学院系列表，比如
	 *    array("计算机系", "化学院")
	 */
	public static function getDepsByUnivName($unv_name) {
		foreach (self::$_universities as &$univs) {
			foreach ($univs["univs"] as &$univ) {
				if ($univ[1] == $unv_name)
					return self::getDeps($univ[0]);
			}
		}
		return array();
	}



